export default (function(a,b,c,d,e,f,g,h,i,j){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:d,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:d,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:e,pageSize:25,pageCount:e,total:5}}},MRuJYlmpbu:{data:{id:1052,attributes:{imdbId:"tt1502712",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTk0OTMyMDA0OF5BMl5BanBnXkFtZTgwMzY5NTkzNTE@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"4.2\u002F10"},{Source:"Rotten Tomatoes",Value:"9%"},{Source:"Metacritic",Value:"27\u002F100"}],item_lang:{data:{id:1715,attributes:{title:f,plot:"FANTASTIC FOUR, a contemporary re-imagining of Marvel's original and longest-running superhero team, centers on four young outsiders who teleport to an alternate and dangerous universe, which alters their physical form in shocking ways. Their lives irrevocably upended, the team must learn to harness their daunting new abilities and work together to save Earth from a former friend turned enemy.",slug:"fantastic-four"}}},books:{data:[{id:6076,attributes:{title:"Stan Lee's How to Write Comics",description:"Comics icon Stan Lee, creator of the Mighty Marvel Universe, has set about to teach everything he knows about writing and creating comic book characters. In these pages, aspiring comics writers will learn everything they need to know about how to write their own comic book stories, complete with easy to understand instruction, tips of the trade, and invaluable advice even for more advance writers. From the secrets to creating concepts, plots, to writing the script, the man with no peer — Stan Lee—is your guide to the world of writing and creating comics.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=OB3coAfXoWoC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:"2011-10-11",publisher:g,subtitle:"From the Legendary Co-Creator of Spider-Man, the Incredible Hulk, Fantastic Four, X-Men, and Iron Man"}},{id:6077,attributes:{title:f,description:"Collects Fantastic Four (1961) #48-50, #120-123 and #242-244. Continuing the series of graphic novels handpicked by Marvel Editorial to showcase pivotal storylines written and drawn by some of Marvel’s most acclaimed creators! Three of the greatest Galactus stories of all — by a fantastic foursome of comic-book titans! First, Stan Lee and Jack Kirby introduce the World-Eater and his enigmatic herald, the Silver Surfer, as the Fantastic Four stand in defense of Earth in one of the most beloved sagas ever told! Next, John Buscema’s powerful pencils illustrate the arrival of new herald Gabriel the Air-Walker, signaling doom for the human race! Then, John Byrne takes over as Terrax leads the Devourer back to Earth — and the entire Marvel Universe pitches in to help save the planet from becoming his next meal! The FF plus the big G spells cosmic action in the Mighty Marvel Manner!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=BuSxDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a,"John Byrne"],firstBook:c,published:"2019-10-23",publisher:"Marvel Entertainment",subtitle:"Behold… Galactus! Marvel Select"}},{id:6078,attributes:{title:"Stan Lee's How to Draw Comics",description:"In Stan Lee's How to Draw Comics, Stan Lee reveals his secrets for: * Costumes * Penciling, Inking & Coloring * Lettering & Word Balloons * Digital Advances * Perspective & Foreshortening * What Makes Great Action * Page & Panel Layout * Covers * Creating a Portfolio * Getting Work When it comes to comic books, one name says it all: Stan Lee. His characters are classics. His industry knowledge is vast. His creativity is boundless. And now, he’s sharing what he knows with you, Grasshopper! His cohorts have always been—and still are—some of the best in the business: Jack Kirby, John Romita, Sr., Neal Adams, Gil Kane, Mike Deodato, Jr., Frank Cho, and Jonathan Lau, and many others, Stan includes their work here and discusses what exactly makes it so great. He touches on all the important stuff: anatomy, foreshortening, perspective, action, penciling, inking, hand lettering vs. digital lettering, color, character and costume design, panel flow, materials and tools, computers, file formats, and software. He includes an overview of the history and development of the comic book industry, and there’s an extensive section on various types of covers—the super important element that makes the reader want to pick up that comic! In a world where good battles evil at every turn and the hero fights valiantly to get the girl, no stone is left unturned! Here you’ll also find info on all the small details—that really aren’t so small: word balloons, thought balloons, whisper balloons, bursts, sound effect lettering, and splash pages! And KA-BLAMMM! . . . once you’ve created your art, then what? Lest you think Stan would turn you out into the wilderness without a road map, fellow traveler, there’s also information on preparing and submitting your portfolio, on getting work, and on suggested reading and schools. Stan Lee’s How to Draw Comics features a cover that reunites long time collaborator John Romita Sr. and original cover artist of How to Draw Comics the Marvel Way. John Romita Sr. was most famous for his collaboration on The Amazing Spider-Man with Stan Lee! It’s time for a new approach . . . “a cornucopia of cutting-edge, techno-savvy instructions to lead you down the freshly laid yellow brick road of creativity.” It’s time for a book that takes you on the new journey of creating comic books for the 21st century and beyond! Excelsior!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=xOMr_k0z-wMC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2011-10-12",publisher:g,subtitle:"From the Legendary Creator of Spider-Man, The Incredible Hulk, Fantastic Four, X -Men, and Iron Man"}},{id:6079,attributes:{title:"The Fantastic Four Omnibus Vol. 4",description:"Celebrate 60 years of the World's Greatest Comics Collaboration! Stan Lee and Jack Kirby conclude their record-setting tenures on the FANTASTIC FOUR, the book that birthed the Marvel Universe! In Kirby's final issues, Doctor Doom lurks in the shadows, the FF save Apollo 11 from an alien threat, and the Sub-Mariner and Magneto team up to attack our heroes! Then, Stan Lee is joined by Marvel art legends John Romita Sr. and John Buscema to forge a new future for Marvel's first family! Along the way, the Thing battles the Hulk, the Surfer is taken captive by Galactus, and the Overmind menaces Earth -- leading to the strangest event in Marvel history: Doctor Doom joins the FF?! Guest-starring Black Panther, the Inhumans and more! COLLECTING: Fantastic Four (1961) 94-125, Fantastic Four: The Lost Adventure (2008) 1, material from Fantastic Four Annual (1963) 8-9",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ibJkzgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a,"Archie Goodwin"],firstBook:c,published:h,publisher:i,subtitle:j}},{id:6080,attributes:{title:"Fantastic Four Epic Collection: The World's Greatest Comic Magazine",description:"In 1961, Stan Lee and Jack Kirby lit the fuse of the greatest revolution in comic-book history -- the Marvel Age of Comics -- and it started right here, in the pages of FANTASTIC FOUR! With the space race on, Reed Richards, Ben Grimm, Sue Storm and Johnny Storm shoot for the stars -- but after their craft is bombarded by cosmic rays, they return to Earth with the startling powers of the Fantastic Four! These weren't just any super heroes, though -- the Fantastic Four were a realistic, relatable, bickering and loveable family that couldn't pay their rent and didn't always love their powers. So crack open this Epic Collection and enjoy the beginning of the series that earned the name \"The World's Greatest Comic Magazine!\" COLLECTING: Fantastic Four (1961) 1-18",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=sURlzgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:h,publisher:i,subtitle:j}}]}}},meta:{}}},prerenderedAt:1681309488393}}("Stan Lee","movie",null,"series",1,"Fantastic Four","Watson-Guptill","2021-09-07","Marvel",""))